import React from 'react';
import styled from 'styled-components';

import Logo from '../../images/logo.png';

const LogoImg = styled.img`
  width: 100%;
  height: 100%;
`;

const LogoContainer = styled.div`
  width: 30px;
  height: 30px;
`;

function Header() {
  return (
    <div>
      <LogoContainer>
        <LogoImg src={Logo} />
      </LogoContainer>
    </div>
  );
}

export default Header;
